import { ThemeProvider } from 'styled-components';
import GlobalStyled from './styles/GlobalStyled';

import Layout from './components/Layout';
import dark from './styles/themes/dark';

const App: React.FC = () => {

    return (
        <ThemeProvider>
            <GlobalStyled />
            <Layout />
        </ThemeProvider>
    );
}

export default App;
